import React from "react";

function Designer(){

    return(
        <Box sx={{display:'flex' , justifyContent:'center', width:"100%"}}>
            <Box component="img" src="img/designer.png" width="90%" height='100%'></Box>

        </Box>
    );
}

export default Designer;
